import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a "Your Profile" link to be visible (multiple may exist, use the first visible one)
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });

    // Scroll into view and click the first visible "Your Profile" link
    await profileLink.scrollIntoViewIfNeeded();
    await profileLink.click();

    // Wait for Jun's profile to load: look for Jun's name or username in the DOM
    // Try to wait for either "Jun Kim" or "@jun" to appear
    let profileHeaderSelector = null;
    try {
      profileHeaderSelector = await page.waitForSelector('text=Jun Kim', { timeout: 5000 });
    } catch {
      profileHeaderSelector = await page.waitForSelector('text=@jun', { timeout: 5000 });
    }

    // Take a screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_jun_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_jun_profile.png'));

    // Extract Jun's full name, username, and bio from the profile section
    const extractedData = await page.evaluate(() => {
      const fullName = document.querySelector('.profile-info h2')?.innerText || '';
      const username = document.querySelector('.profile-info .username')?.innerText || '';
      const bio = document.querySelector('.profile-info .bio')?.innerText || '';
      return { fullName, username, bio };
    });

    return {
      success: true,
      action: "Navigated to Jun's Profile and extracted profile information",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
